import Order from './Order';
import Orderdetails from './Orderdetails';
import Point from './Point';
import Pointdetails from './Pointdetails';
import Shop from './Shop';
import Shopdetails from './Shopdetails';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
function App() {
  return (
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Pointdetails />} />
          <Route path="/" element={<Shop/>}/>
          <Route path="/shop" element={<Shopdetails/>}/>
          <Route path="/shopdetails" element={<Order/>}/>
          <Route path="/order" element={<Orderdetails/>}/>
          <Route path="/orderdetails" element={<Point/>}/>
          <Route path="/point" element={<Pointdetails/>}/>
          <Route path="/pointdetails" element={<Pointdetails/>}/> 

        </Routes>
     </BrowserRouter>
  )
}

export default App
